package codejava;

public class relationaloperator {
	

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		// int a=3 b=13
				
		
		// == Operator
		System.out.println(3==13);
		// != Operator
	    System.out.println(3!=13);
	    // < Operator
	    System.out.println(3<13);
	    // > Operator
	    System.out.println(3>13);
	    // >= Operator
	    
	    System.out.println(13>=3);
	    // <= Operator
	    System.out.println(13<=3);
	  
	}

}
